t\",\"authors\":[],\"changes\":[]},\"subContentId\":\"bb3dcf4a-4a52-49cf-a101-d1f1077e61df\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"45cd0d05-bb11-4a72-b52b-bcaae72326ea\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. Identify the type of motion of the wheels of the car.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"9d64fa32-5552-4b74-ac63-b8c98dc5e297\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Questions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Questions\"},\"subContentId\":\"8818e03e-81d0-4bee-8828-fa5e762fbe1c\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1.The driver is at rest with respect to the car, because his position does not change.</p>\\n\\n<p>He is in motion with respect to the ground because his position changes.</p>\\n\\n<p>2. The wheels describe a circular trajectory around their axis which means that they are in a rotational motion.</p>\\n\\n<p>The axes of the wheels describe a curved path as their trajectory which means that they are in a curvilinear translational motion.</p>\\n\\n<p>Therefore, the wheels are in a complex (combined translational rotational) motion.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9241d0e9-2420-4653-88a0-7a13c1b688d9\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.Standa "library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"8fffefaa-f728-4a3f-81e0-8838031ad722\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. Are the pilot and the co-pilot in motion with respect to each other? Are they in motion with respect to the people observing the flying helicopter?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"6eb228c0-01ba-49aa-bd2c-6ac118de3725\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Questions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Questions\"},\"subContentId\":\"c9cd09fc-2d1e-4548-ae30-05696cf47650\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. The blades rotate around their axis, which means that they are in a rotational motion. Meanwhile, the axis of the blades is in a curvilinear translational motion. Therefore, the blades are in a complex motion.</p>\\n\\n<p>2. The positions of both the pilot and the co-pilot are not changing with respect to each other. Therefore, they are at rest.</p>\\n\\n<p>While, their position with respect to the observing people is changing. They are considered as a part of the moving helicopter. So, they are in motion with respect to the people standing on the ground.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"6dffb7c3-d8f3-4235-ad71-b4372edd9abe\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answers\",\"authors\ tType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"c7db4c9d-5222-4ed5-b70b-979925df5395\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problems\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problems\"},\"subContentId\":\"e444f66f-dad9-4f8f-9c17-e7548f7fd71a\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. The earth rotates about its axis in a rotational motion. The axis revolves around the Sun in a curvilinear translational motion. Therefore, the earths motion with respect to the Sun is complex.</p>\\n\\n<p>Earths path around the Sun is called its orbit, and its shape is elliptical (oval).</p>\\n\\n<p>2. The Moon revolves around the Earth. The Earth revolves around the Sun. Consequently,the Moon revolves around the Sun.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"25d77232-b108-43fc-afe5-a7f937f95583\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answers\"},\"subContentId\":\"f1cdcc1b-ffe1-47f0-94ef-b227d857eac7\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Untitled Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Documentation Tool\"},\"subContentId\":\"4fdd5648-a417-44ff-82d2-e34189ed8d7f\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.15","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Complex Problems","defaultLanguage":"und","authors":[{"name":"LAL-Tabshou
